/******************************************************************************/
static HERROR	nx_antenna_ConvDefaultTpInfoToTuningInfo (const Nx_SAT_TunningInfo_t *pDefaultTpInfo, NX_TP_TuningInfo_t *pstTpInfo);


/******************************************************************************/
#define _________Private_functions____________________________________________
/******************************************************************************/

static HERROR	nx_antenna_ConvDefaultTpInfoToTuningInfo (const Nx_SAT_TunningInfo_t *pDefaultTpInfo, NX_TP_TuningInfo_t *pstTpInfo)
{
	if ((pDefaultTpInfo == NULL) || (pstTpInfo == NULL))
	{
		NX_APP_Error("[%s:%d] Error!!! pDefaultTpInfo or pstTpInfo is NULL!!\n", __FUNCTION__, __LINE__);
		return	ERR_FAIL;
	}

	pstTpInfo->sat.ulFrequency =pDefaultTpInfo->ulFrequency;
	pstTpInfo->sat.ulSymbolRate =pDefaultTpInfo->ulSymbolRate;
	pstTpInfo->sat.ePolarization = pDefaultTpInfo->ePolarization;
	pstTpInfo->sat.eFecCodeRate = pDefaultTpInfo->eFecCodeRate;
	pstTpInfo->sat.ePskMod = pDefaultTpInfo->ePskMod;
	pstTpInfo->sat.eTransSpec = pDefaultTpInfo->eTransSpec;
	pstTpInfo->sat.bFindSat = pDefaultTpInfo->bFindSat;
	pstTpInfo->sat.ePilot = eDxSAT_PILOT_AUTO;
	pstTpInfo->sat.eRollOff = eDxSAT_ROLL_035;

	return ERR_OK;
}


/******************************************************************************/
#define _________Public_Functions_____________________________________________
/******************************************************************************/

HERROR		NX_ANTENNA_CountDefaultTpBySatTypeName(const HCHAR *szSatName, HUINT32 *pulNumberOfTps)
{
	HUINT32		ulSatIdx = 0;
	HUINT32		ulSatDefaultListCount = 0;

	if (pulNumberOfTps == NULL)
	{
		NX_APP_Error("[%s:%d] Error!!! pulNumberOfTps is NULL!!\n", __FUNCTION__, __LINE__);
		return	ERR_FAIL;
	}

	ulSatDefaultListCount = sizeof(s_astSatelliteDefaultLists) / sizeof(Nx_SAT_DefaultTpList_t);
	for (ulSatIdx = 0; ulSatIdx < ulSatDefaultListCount; ulSatIdx++)
	{
		if (HxSTD_StrCmp(s_astSatelliteDefaultLists[ulSatIdx].szSatName, (char*)NX_SAT_SATNAME_NONE) == 0)
		{
			break;
		}

		if (HxSTD_StrCmp(s_astSatelliteDefaultLists[ulSatIdx].szSatName, szSatName) == 0)
		{
			*pulNumberOfTps = s_astSatelliteDefaultLists[ulSatIdx].ulTpNum;
			return	ERR_OK;
		}
	}

	return	ERR_FAIL;
}


HERROR		NX_ANTENNA_GetDefaultTpBySatTypeName(const HCHAR *szSatName, HUINT32 ulTpIdx, NX_TP_TuningInfo_t *pstTpInfo)
{
	HUINT32		ulSatIdx = 0;
	HUINT32		ulSatDefaultListCount = 0;

	if (pstTpInfo == NULL)
	{
		NX_APP_Error("[%s:%d] Error!!! pstTpInfo is NULL!!\n", __FUNCTION__, __LINE__);
		return ERR_FAIL;
	}

	ulSatDefaultListCount = sizeof(s_astSatelliteDefaultLists) / sizeof(Nx_SAT_DefaultTpList_t);
	for (ulSatIdx = 0; ulSatIdx < ulSatDefaultListCount; ulSatIdx++)
	{
		if (HxSTD_StrCmp(s_astSatelliteDefaultLists[ulSatIdx].szSatName, (char*)NX_SAT_SATNAME_NONE) == 0)
		{
			break;
		}

		if (HxSTD_StrCmp(s_astSatelliteDefaultLists[ulSatIdx].szSatName, szSatName) == 0)
		{
			if (ulTpIdx >= s_astSatelliteDefaultLists[ulSatIdx].ulTpNum)
			{
				NX_APP_Error("[%s:%d] Error!!! ulTpIdx[%d] > ulTpNum[%d] is NULL!!\n", __FUNCTION__, __LINE__, ulTpIdx, s_astSatelliteDefaultLists[ulSatIdx].ulTpNum);
				return ERR_FAIL;
			}

			nx_antenna_ConvDefaultTpInfoToTuningInfo (&(s_astSatelliteDefaultLists[ulSatIdx].pstTpArray[ulTpIdx]), pstTpInfo);
			HxSTD_StrNCpy(pstTpInfo->sat.satType, szSatName, (DxANTINFO_NAME_LEN - 1));
			pstTpInfo->sat.satType[DxANTINFO_NAME_LEN - 1] = '\0';
			return ERR_OK;
		}
	}

	return	ERR_FAIL;
}


Nx_SAT_SatRegionList_t *NX_ANTENNA_GetRegionSatList (NX_SAT_SatelliteRegionType_t eSatRegionType, HUINT32 *ulNum)
{
	*ulNum = 0;
	switch (eSatRegionType)
	{
		case eNxSat_SatRegion_Normal:
			*ulNum = NX_SAT_SATREGION_LIST_NUM_NORMAL;
			return	(Nx_SAT_SatRegionList_t *)s_astSatRegionList_Normal;
		case eNxSat_SatRegion_MeSat:
			*ulNum = NX_SAT_SATREGION_LIST_NUM_MESAT;
			return	(Nx_SAT_SatRegionList_t *)s_astSatRegionList_MeSat;
		case eNxSat_SatRegion_SouthAmerica:
			*ulNum = NX_SAT_SATREGION_LIST_NUM_SOUTHAMERICA;
			return	(Nx_SAT_SatRegionList_t *)s_astSatRegionList_SouthAmerica;
		default:
			*ulNum = NX_SAT_SATREGION_LIST_NUM_NORMAL;
			return	(Nx_SAT_SatRegionList_t *)s_astSatRegionList_Normal;
	}
}


HERROR		NX_ANTENNA_GetSatDegree(HCHAR *szSatName, HINT16 *psSatDegree)
{
	HINT32	i = 0, lNuumSat = 0;

	lNuumSat = sizeof(s_astSatPosList) / sizeof(Nx_SAT_SatPosInfo_t);

	for (i = 0; i<lNuumSat; i++)
	{
		if (HxSTD_StrCmp(s_astSatPosList[i].szSatName, szSatName) == 0)
		{
			*psSatDegree = s_astSatPosList[i].sSatDegree;

			return	ERR_OK;
		}
	}

	return	ERR_FAIL;
}


